import React, { useState } from 'react';

const DoctorProfile = () => {
  // State to store the form input values
  const [profileData, setProfileData] = useState({
    name: '',
    doctorId: '',
    experience: '',
    specialty: '',
    location: '',
    hospitalName: '',
    email: '',
    mobile: '',
    photo: null
  });

  // State to store the doctor profile information after submission
  const [submittedProfile, setSubmittedProfile] = useState(null);

  // Handle change for form inputs
  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfileData({
      ...profileData,
      [name]: value
    });
  };

  // Handle file upload for profile photo
  const handleFileChange = (e) => {
    setProfileData({
      ...profileData,
      photo: e.target.files[0]
    });
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    // Set the submitted profile data to display after submission
    setSubmittedProfile(profileData);

    // Reset the form after submission (optional)
    setProfileData({
      name: '',
      doctorId: '',
      experience: '',
      specialty: '',
      location: '',
      hospitalName: '',
      email: '',
      mobile: '',
      photo: null
    });
  };

  return (
    <div className="doctor-profile-container">
      <h2>Create Your Profile</h2>
      
      <form onSubmit={handleSubmit} className="doctor-profile-form">
        <div className="form-group">
          <label>Name:</label>
          <input
            type="text"
            name="name"
            value={profileData.name}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Doctor ID:</label>
          <input
            type="text"
            name="doctorId"
            value={profileData.doctorId}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Experience (in years):</label>
          <input
            type="number"
            name="experience"
            value={profileData.experience}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Specialty:</label>
          <input
            type="text"
            name="specialty"
            value={profileData.specialty}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Location:</label>
          <input
            type="text"
            name="location"
            value={profileData.location}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Hospital Name:</label>
          <input
            type="text"
            name="hospitalName"
            value={profileData.hospitalName}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Email:</label>
          <input
            type="email"
            name="email"
            value={profileData.email}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Mobile Number:</label>
          <input
            type="tel"
            name="mobile"
            value={profileData.mobile}
            onChange={handleChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Profile Photo:</label>
          <input
            type="file"
            name="photo"
            onChange={handleFileChange}
          />
        </div>

        <button type="submit">Submit</button>
      </form>

      {submittedProfile && (
        <div className="profile-summary">
          <h3>Profile Summary:</h3>
          <ul>
            <li><strong>Name:</strong> {submittedProfile.name}</li>
            <li><strong>Doctor ID:</strong> {submittedProfile.doctorId}</li>
            <li><strong>Experience:</strong> {submittedProfile.experience} years</li>
            <li><strong>Specialty:</strong> {submittedProfile.specialty}</li>
            <li><strong>Location:</strong> {submittedProfile.location}</li>
            <li><strong>Hospital Name:</strong> {submittedProfile.hospitalName}</li>
            <li><strong>Email:</strong> {submittedProfile.email}</li>
            <li><strong>Mobile Number:</strong> {submittedProfile.mobile}</li>
            {submittedProfile.photo && (
              <li><strong>Profile Photo:</strong><img src={URL.createObjectURL(submittedProfile.photo)} alt="Profile" width="100" /></li>
            )}
          </ul>
        </div>
      )}
    </div>
  );
};

export default DoctorProfile;
